// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./ChatRoom.sol";

/*
    Контракт в котором осущетсвляется логика управления чатом
    Доход с сообщений сохраняется в этом кнтракте
    При создании данного контракта так же создаётся контракт ChatRoom
    ChatRoom привязан к этому кнтракту а не к влпадельцу

    Что сделано:
    1 Создаётся ChatRoom в конструкторе
    2 можно менять цену сообщений
    3 написана логика распределения которая будет вызываться при отправки сообщений в ChatRoom
    4 Владелец может сделать вывод средств

    Что необходимо сделать:
    1 система паузы
    2 рассмотреть систему цены
*/

contract ChatRoomFinance is Ownable {

    uint256 public messagePrice;

    address payable public developerContract;

    // Чат начинается на паузе
    bool public isPaused = true;

    // Ссылка на ассоциированный чат
    ChatRoom public chatRoom;

    event MessagePriceUpdated(uint256 newPrice);

    constructor(uint256 _messagePrice, address payable _developerContract , address _owner) Ownable(_owner) {
        messagePrice = _messagePrice;
        developerContract = _developerContract;

        // Создаем чат с ссылкой на этот финансовый контракт
        chatRoom = new ChatRoom(address(this));
    }

    function updateMessagePrice(uint256 _newPrice) external onlyOwner {
        messagePrice = _newPrice;
        emit MessagePriceUpdated(_newPrice);
    }

    // Вспомогательная функция для проверки баланса контракта
    function getBalance() public view onlyOwner returns (uint256) {
        return address(this).balance;
    }

    function withdraw(address payable _to) external onlyOwner {
        require(_to != address(0), "Invalid address");
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds available");
        _to.transfer(balance);
    }

    function processPayment(uint256 ownerCommissionPercent) public payable {
        require(msg.value >= messagePrice, "Not enough Ether sent");

        uint256 ownerCommission = (msg.value * ownerCommissionPercent) / 100;
        uint256 developerCommission = msg.value - ownerCommission;

        payable(owner()).transfer(ownerCommission);
        developerContract.transfer(developerCommission);
    }

    // Переопределение метода transferOwnership для передачи владения как финансами, так и чатом
    function transferOwnership(address newOwner) public override onlyOwner {
        require(newOwner != address(0), "New owner is the zero address");
        address oldOwner = owner();
        super.transferOwnership(newOwner); // Передаем владение ChatRoomFinance
        emit OwnershipTransferred(oldOwner, newOwner);
    }
}

